				clearInterval(textCountdown); //ביטול ספירה לאחור
				stage.removeChild(countDown); //מחיקת טקסט ספירה לאחור
				createjs.Ticker.addEventListener("tick", myTick); //יצירת טיקר בהתחלת המשחק
